DROP TABLE IF EXISTS `recitems`;

CREATE TABLE `recitems` (
	`rid` int(10) NOT NULL DEFAULT '0',
	`item` int(10) NOT NULL DEFAULT '0',
	`q` int(10) NOT NULL,
	`has_recipe` int(10) NOT NULL DEFAULT '0',
	PRIMARY KEY (`rid`,`item`),
	KEY `item` (`item`),
	KEY `has_recipe` (`has_recipe`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8;

